import React from "react";
import "../styles/Tools.css";

const Tools = props => {
  const { solve, stop, newGame, deleteGame, getThisAsStr, goBack } = props;
  return (
    <div className="button-container">
      <button className="button new-game" onClick={e => newGame()}>
        New Game
      </button>
      <button className="button solve" onClick={solve}>
        Solve
      </button>
      <button className="button incorrect" onClick={stop}>
        Stop
      </button>
      <button className="button delete" onClick={deleteGame}>
        Delete
      </button>
      <button className="button back" onClick={goBack}>
        Go back
      </button>
    </div>
  );
};

export default Tools;
